import styles from "./picture.module.css"

const Pictures = () => {
    return (
        <div className={styles.outer__div}>
        
          <div>
              <img src="https://i.postimg.cc/XvdWT5Gk/final-image-removebg-preview-2-1.png" alt="prop"/>
          </div>
        </div>
    )
}

export default ictures
